/**
 * Represents the Customer for the checkout.
 * This MUST match the Customer.java DTO in Spring.
 * Note the lowercase field names.
 */
export class Customer {
  id: number = 0;
  firstname: string;  // NOT firstName
  middlename: string; // NEW
  lastname: string;   // NOT lastName
  dateOfBirth: Date;  // NEW
  gender: string;     // NEW
}
